import React from "react";
import { Routes, Route, Navigate, useLocation, useNavigate } from "react-router-dom"
import Red from "./lighter/Red";
import Yellow from "./lighter/Yellow";
import Green from "./lighter/Green";

function App() {
  const navigate = useNavigate()
	const location = useLocation()

  return (
    <> 
      <Routes>
        <Route path="/" element={<Navigate to="/red" replace/>}/>
        <Route path="/red" element={<Red navigate={navigate} location={location}/>}/>
        <Route path="/yellow" element={<Yellow navigate={navigate} location={location}/>}/>
        <Route path="/green" element={<Green navigate={navigate} location={location}/>}/>
      </Routes>
    </>
  );
}

export default App;
